		tl.call(bloGo, [self.blo41, self.blo42, self.blo43, self.blo44, d], 0);
		
		tl.from(self.b4, {duration:0.5, alpha:0, ease:"none", onStart: function () {clickT = window.clickTag3}}, d-0.5);
		
